inputs =[	"",
			"",
			"",
			"",
			""
]

numpad = [
	[ 0 , 0 , 1 , 0 , 0 ],
	[ 0 , 2 , 3 , 4 , 0 ],
	[ 5 , 6 , 7 , 8 , 9 ],
	[ 0 ,'A','B','C', 0 ],
	[ 0 , 0 ,'D', 0 , 0 ]

]

x,y = 0,3

for i, input in enumerate(inputs):
	for j, dir in enumerate(input):
		
		ox,oy = x,y

		if dir == "L" and x > 0:
			x -= 1
		elif dir == "R" and x < 4: 
			x += 1
		elif dir == "U" and y > 0:
			y -= 1
		elif dir == "D" and y < 4:
			y += 1

		if numpad[y][x] == 0:
			x,y = ox,oy
		
	print(numpad[y][x])